import React, {useState, useEffect} from 'react';
import News from './News'

import {CardHeader, Card, CardMedia, Typography, Avatar, CardContent} from "@material-ui/core"
import { red } from '@material-ui/core/colors';

import { fade, makeStyles } from '@material-ui/core/styles'

const Unauthorization = () => {
  const [allNews, setAllNews] = useState([])
  useEffect(() =>{
    fetch("https://newsapi.org/v2/everything?q=fitness&apiKey=6506d673db3c4724b89c8306b2af7787")
    .then(res => res.json())
    .then(news => {
      setAllNews(news.articles)
    })
  })


  const useStyles = makeStyles((theme) => ({
  root: {
    maxWidth: 345,
  },
  media: {
    height: 0,
    paddingTop: '56.25%', // 16:9
  },
  avatar: {
    backgroundColor: red[500],
  },
}));

  return (
    <header className="App-page">
      <div>
      {allNews.map(news => 
        <div>
        <Card className={useStyles().root}>
        <CardHeader
          avatar={
            <Avatar aria-label="recipe" className={useStyles().avatar}>
              R
            </Avatar>
          }
          title="Shrimp and Chorizo Paella"
          subheader="September 14, 2016"
        />
        <CardMedia
          className={useStyles().media}
          image="/static/images/cards/paella.jpg"
          title="Paella dish"
        />
        <CardContent>
          <Typography variant="body2" color="textSecondary" component="p">
            This impressive paella is a perfect party dish and a fun meal to cook together with your
            guests. Add 1 cup of frozen peas along with the mussels, if you like.
          </Typography>
        </CardContent>
        </Card>
      </div>
        )}




      </div>
    </header>
  )
}

export default Unauthorization;
